INSERT INTO `Reviews` VALUES (1,'https://twitter.com/CharlieShrem/status/835537948225454084','Charlie Shrem','I love how @smartjex has no limits and awesome fees when going from crypto to crypto. No reason for exchanges!','2017-02-25',1,'2018-04-25 19:50:09','2018-04-25 19:50:09'),(2,'https://steemit.com/money/@borishaifa/thank-you-changelly-spasibo-changelly','Borishaifa','... I made my first transaction without memo. I was ready to say \"Good-bye!\", but wrote to Support... I got this answer: \"Please, provide the hash of your payment, we\'ll try to push it manually...\". And they really did it. They helped me get this transaction.','2016-11-20',5,'2018-04-25 19:50:09','2018-04-25 19:50:09'),(3,'https://bitcointalk.org/index.php?topic=1435275','Ryan Dugan','Very professional and well Woking system. Very fast. Within minutes my transactions were on their way to my bitcoin wallet. Great job guys keep it coming!','2016-11-13',2,'2018-04-25 19:50:09','2018-04-25 19:50:09'),(4,'https://twitter.com/Programmarchy/status/813423970372325376','Donald Ness','Had a flawless experience using @Changelly_team for some crypto trades this morning. Nice work guys.','2017-01-16',3,'2018-04-25 19:50:09','2018-04-25 19:50:09'),(5,'https://twitter.com/AscensionEnergy/status/882000322570465280','Kevin Courtois','...fees are reasonable and not loanshark level!','2017-07-04',4,'2018-04-25 19:50:09','2018-04-25 19:50:09'),(6,'https://steemit.com/cryptocurrency/@delusionalgenius/changelly-technical-support-is-nice-fast-awesome-and-honest','delusionalgenius','Smartjex technical support is nice, fast, awesome, and honest.','2017-10-28',6,'2018-04-25 19:50:09','2018-04-25 19:50:09');
