t from your wallet.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(415,'en','ABOUT__MENU__ITEM','About us','2018-07-15 21:00:43','2018-07-15 21:00:43'),(416,'en','ABOUT__META__TITLE','About SMARTJEX','2018-07-15 21:00:43','2018-07-15 21:00:43'),(417,'en','ABOUT__META__KEYWORDS','About us','2018-07-15 21:00:43','2018-07-15 21:00:43'),(418,'en','ABOUT__META__DESCRIPTION','SMARTJEX exchanges bitcoins and lots of other crypto, calculates their best rates, and quickly sends already converted assets directly to your wallet. ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(419,'en','ABOUT__PAGE__TITLE','About Us','2018-07-15 21:00:43','2018-07-15 21:00:43'),(420,'en','ABOUT__PAGE__SUBTITLE','About the service','2018-07-15 21:00:43','2018-07-15 21:00:43'),(421,'en','ABOUT__PAGE__CONTENT','We are an independent company with hands-on experience in cryptomarkets. Our mission is to deal with routine and create new ways of implementing cryptocurrency into practice by developing blockchain-based products. <br/> We underpin the needs of the market and try to offer brand-new or upgraded solutions to be used as the new status quo.<br/> Last year appeared to be the year of altcoins. Thus, it is necessary to have a tool to easily send and receive any currency, converted one into another. That is why we created Smartjex — multiconverter, a crypto-specialized project, designed to raise cryptocurrency exchange to new levels of clarity and comfort.<br/>Smartjex exchanges bitcoins and lots of other crypto, calculates their best rates, and quickly sends already converted assets directly to your wallet. <br/>Smartjex refers to exchange platforms via their API, it does not request any personal data and has transparent fees: <ul><li>it’s own fee will not exceed 1% of the transaction. The platforms’ fees are usually mentioned on their sites (we reflect what platform is used as the intermediary) — and all this is already included in the offered rates, so you see the total sum except the blockchain fee;</li> <li>independent blockchain fees are shown in your wallet during the very transaction.</li></ul> Stay tuned!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(422,'en','CONTACT_FORM__TITLE','Contact form','2018-07-15 21:00:43','2018-07-15 21:00:43'),(423,'en','CONTACT_FORM__EMAIL_FIELD__LABEL','E-mail','2018-07-15 21:00:43','2018-07-15 21:00:43'),(424,'en','CONTACT_FORM__NAME_FIELD__LABEL','Name','2018-07-15 21:00:43','2018-07-15 21:00:43'),(425,'en','CONTACT_FORM__SUBJECT_FIELD__LABEL','Subject','2018-07-15 21:00:43','2018-07-15 21:00:43'),(426,'en','CONTACT_FORM__MESSAGE_FIELD__LABEL','Enter text...','2018-07-15 21:00:43','2018-07-15 21:00:43'),(427,'en','CONTACT_FORM__SUBMIT_BTN__LABEL','Send','2018-07-15 21:00:43','2018-07-15 21:00:43'),(428,'en','PRIVACY__MENU__ITEM','Privacy Policy','2018-07-15 21:00:43','2018-07-15 21:00:43'),(429,'en','PRIVACY__META__TITLE','Terms of Service','2018-07-15 21:00:43','2018-07-15 21:00:43'),(430,'en','PRIVACY__META__KEYWORDS','Terms of Service','2018-07-15 21:00:43','2018-07-15 21:00:43'),(431,'en','PRIVACY__META__DESCRIPTION','Terms of Service','2018-07-15 21:00:43','2018-07-15 21:00:43'),(432,'en','PRIVACY__PAGE__TITLE','Privacy page title','2018-07-15 21:00:43','2018-07-15 21:00:43'),(433,'en','PRIVACY__PAGE__SUBTITLE','Privacy page subtitle','2018-07-15 21:00:43','2018-07-15 21:00:43'),(434,'en','PRIVACY__PAGE__CONTENT','Smartjex.com (“smartjex.com” or “we”) controls and provides access to the smartjex.com website, currently located at www.smartjex.com (the “Website”). At smartjex.com, we are fully committed to respecting your privacy and to protecting any information that our clients provide. Your privacy and security are both our highest priorities and we make every effort to ensure that all the information provided by you is protected. This Privacy Policy (the “Policy”) is designed to inform you about the terms of treating your personal data.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(435,'en','PRIVACY__PAGE__PERSONAL__TITLE','## Personal Information','2018-07-15 21:00:43','2018-07-15 21:00:43'),(436,'en','PRIVACY__PAGE__PERSONAL','In order to access the functionality of the Website, you will need to register. When registering, you will be asked to provide an email address and create a password. You may also choose to link to the Website using one of your accounts on the social networks, such as Twitter, Facebook and Google+.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(437,'en','PRIVACY__PAGE__RECORD__TITLE','## Record Collection','2018-07-15 21:00:43','2018-07-15 21:00:43'),(438,'en','PRIVACY__PAGE__RECORD__CONTENT','From the moment you register on smartjex.com, our software will start collecting your non-personal identification information. Such information may include your browser’s name and technical information about your means of connection to our Website, in particular the operating system and the Internet service providers used among other similar information.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(439,'en','PRIVACY__PAGE__CONTACT__TITLE','## Contacting us','2018-07-15 21:00:43','2018-07-15 21:00:43'),(440,'en','PRIVACY__PAGE__CONTACT__CONTENT','If you have any questions about this Privacy Policy or the rules of smartjex.com, please contact us at: [support@smartjex.com](mailto:support@smartjex.com)','2018-07-15 21:00:43','2018-07-15 21:00:43'),(441,'en','TERMS__MENU__ITEM','Terms of Use and Privacy Policy','2018-07-15 21:00:43','2018-07-15 21:00:43'),(442,'en','TERMS__META__TITLE','Terms of Service','2018-07-15 21:00:43','2018-07-15 21:00:43'),(443,'en','TERMS__META__KEYWORDS','terms, privacy','2018-07-15 21:00:43','2018-07-15 21:00:43'),(444,'en','TERMS__META__DESCRIPTION','Terms of Use meta description','2018-07-15 21:00:43','2018-07-15 21:00:43'),(445,'en','TERMS__PAGE__TITLE','Terms of Service','2018-07-15 21:00:43','2018-07-15 21:00:43'),(446,'en','TERMS__PAGE__SUBTITLE','Detailed conditions','2018-07-15 21:00:43','2018-07-15 21:00:43'),(447,'en','TERMS__PAGE__CONTENT','Smartjex.com is a website and online platform which enables crypto-currency exchange, i.e., the exchange of unregulated digital money, which is issued and usually controlled by its developers, and used and accepted among the members of specific virtual communities, including but not limited to Bitcoin, NEO, Ether, Litecoin, Ripple, Dash, etc. using the best exchange rate.\nBy using the Website https://smartjex.com/ and further by accepting to avail the services offered by the Website (“Service”), you hereby agree to accept and comply with the Terms and Conditions of use stated herein below (“Terms of Use”).\nBy accessing the website, you agree to be bound by our Terms and all applicable laws, rules and regulations, and that you are responsible for your compliance with them, and that you are compliant with all applicable laws, rules, and regulations. If you do not agree with any of our Terms, you must stop using the Website. Any use of the Website implies your deemed acceptance of our Terms.\nSmartjex reserves the right to make changes to our site, policies and terms of use at any time. The content of the pages of the website is for your general information and use only. It is subject to change without notice.\nBy using the Website, you affirm that you are at least 18 years old, and are fully entitled to contract under applicable law, complying with and obeying all applicable laws, rules and regulations both of your country of Residence and Smartjex’s domain of jurisdiction (“Legislation”).\nThese Terms of Service, the Privacy and Transparency Statement (the “Terms”) and any and all other agreements between Smartjex and its users will use the following definitions:\na. “Customer”, “user”, “client”, “you”,  and “our” refers to the person or entity accessing and/or using Smartjex.\nb. “Company”, “Smartjex”, “Website”, “Service”, “we” and “us” collectively refers to the online website and all products using the Smartjex API, its owners, directors, officers, employees, operators, agents, insurers, suppliers, and attorneys.\nd. “Asset,” “digital asset,” “coin,” “crypto currency,” “funds,” “good,” “ledger entry,” and “token” collectively refers to unregulated digital money, which is issued and usually controlled by its developers, and used and accepted among the members of specific virtual communities, including, but not limited, to Bitcoin, NEO, Ether, Litecoin, Ripple, Dash, etc.\ne. “Partners” are services which Smartjex use to conduct exchange operations, they are listed in Site’s footer;','2018-07-15 21:00:43','2018-07-15 21:00:43'),(448,'en','TERMS__PAGE__CONTENT__FOOTER','1. Smartjex is neither the creator nor the administrator of any cryptocurrency. It merely acts as an aggregator and intermediary between the user and the various partners across the globe through external websites.\n2.The service provided by Smartjex allows all users of the website to exchange cryptocurrency  directly to other cryptocurrency from various virtual currency exchanges.\n3.Smartjex offers intermediary information services for users. We serve only as an interface and compilation of platforms. Financial transactions are performed by partners.\n4.Smartjex grants you a limited nonexclusive nontransferable revocable license to use the Service free of charge.\n5.Smartjex takes an exchange fee for using the service. The fee is 1% of the transaction. The fee can be a subject to reasonable fluctuations due to mathematical rounding. The fee is already included in the listed offerings. Independent blockchain fees are not included in the total sum, you can check them in your wallet during the very transaction.\n6.Smartjex has the right to refuse operations and not to refund your Assets if you violate Terms or Legislation.\n7.You agree to use your own digital wallets, their addresses (“Wallet”), and Assets. You must not use someone else\'s Wallet or Assets.\n8.You are prohibited from using or accessing Smartjex in an abusive manner. This may include, without limitation and in Smartjex\'s sole discretion, submission of transactions or other data which imposes an unreasonable or unmanageably large load on the Smartjex platform, regardless of whether or not it interferes with normal operations.\n9.Smartjex is not responsible for changing the exchange rate due to the volatility of the market. We fix the exchange rate at the time of sending, accurate to within 90 min. We take the data from the following sites through their API. We cannot predict how long the transaction will take and cannot state the ultimate amount of Assets you will receive.\n10.Smartjex will return your initial Assets on the Stated Wallet if the exchange operation does not pass within the 90 minute period.\n11.You cannot cancel the operation after you have transferred money from your wallet.\n12.No valuable data is collected, stored by Smartjex or transmitted to third-party entities.\n13.Smartjex does not operate, transact and otherwise conduct business related ventures with fiat money. We only operate, transact and otherwise conduct business related ventures with crypto-active assets.\n14.No commentary, opinions, posts, review or other written or audio media on the Site, blog, or any side-projects using Smartjex’s code is to be considered official or certified financial advice or recommendation for investment. Smartjex is not responsible for the security of Coins and Tokens offered by the Partners.\n15.Users are responsible for the accuracy of specifying their data, including but not limited to wallet addresses and assets’ specifications. Otherwise Smartjex will not be able to return, transfer and conduct other transactions.\n16.Smartjex makes a unilateral decision about the return of funds and the reimbursement rate. You can not appeal against it. \n17.Smartjex is not responsible for loss, harm or damage that comes as a result of accessing any false portrayal of the site or related services by unaffiliated entities portraying themselves intentionally or unintentionally to be related to or connected with the site. We advise that you verify that the web address is https://smartjex.com/\n18.All disagreements and legal obligations are resolved according to the laws and legislation of the Republic of Cyprus.\n19.Smartjex is not responsible for any loss, caused by any reason, while working with the Exchange. Any losses caused by third-party activities must be resolved by the user.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(449,'en','CURRENCIES__MENU__ITEM','Supported currencies','2018-07-15 21:00:43','2018-07-15 21:00:43'),(450,'en','CURRENCIES__META__TITLE','Exchange supported currencies | SMARTJEX','2018-07-15 21:00:43','2018-07-15 21:00:43'),(451,'en','CURRENCIES__META__KEYWORDS','Exchange supported currencies','2018-07-15 21:00:43','2018-07-15 21:00:43'),(452,'en','CURRENCIES__META__DESCRIPTION','Supported currencies for convertation','2018-07-15 21:00:43','2018-07-15 21:00:43'),(453,'en','CURRENCIES__PAGE__TITLE','Supported currencies','2018-07-15 21:00:43','2018-07-15 21:00:43'),(454,'en','CURRENCIES__PAGE__SUBTITLE','Now we are supporting over %d cryptocurrencies to trade across all major exchanges','2018-07-15 21:00:43','2018-07-15 21:00:43'),(455,'en','CURRENCIES__SEARCH_FIELD__PLACEHOLDER','Search currencies','2018-07-15 21:00:43','2018-07-15 21:00:43'),(456,'en','CURRENCIES__TABLE__COLUMN__NAME_AND_SYMBOL','Name & Ticker','2018-07-15 21:00:43','2018-07-15 21:00:43'),(457,'en','CURRENCIES__TABLE__COLUMN__RATE','Rate','2018-07-15 21:00:43','2018-07-15 21:00:43'),(458,'en','CURRENCIES__TABLE__COLUMN__1_HOUR_CHANGES','1h','2018-07-15 21:00:43','2018-07-15 21:00:43'),(459,'en','CURRENCIES__TABLE__COLUMN__24_HOURS_CHANGES','24h','2018-07-15 21:00:43','2018-07-15 21:00:43'),(460,'en','CURRENCIES__TABLE__COLUMN__7_DAYS_CHANGES','7d','2018-07-15 21:00:43','2018-07-15 21:00:43'),(461,'en','CURRENCIES__TABLE__EXCHANGE_BUTTON','Exchange %s','2018-07-15 21:00:43','2018-07-15 21:00:43'),(462,'en'