n the wallet address, 3) send the initial crypto to any given wallet. That’s it!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(480,'en','ADVANTAGE__ITEM__FAIR__TITLE','Fair','2018-07-15 21:00:43','2018-07-15 21:00:43'),(481,'en','TRACK_ORDER__INPUT_PLACEHOLDER','Enter the order ID','2018-07-15 21:00:43','2018-07-15 21:00:43'),(482,'en','PARTNERS__SECTION__TITLE','Our partners','2018-07-15 21:00:43','2018-07-15 21:00:43'),(483,'en','HOW_IT_WORKS__SECTION__TITLE','How it works','2018-07-15 21:00:43','2018-07-15 21:00:43'),(484,'en','HOW_IT_WORKS__ITEM__COMPARE__TITLE','Pick','2018-07-15 21:00:43','2018-07-15 21:00:43'),(485,'en','ADVANTAGE__SECTION__TITLE','Advantages','2018-07-15 21:00:43','2018-07-15 21:00:43'),(486,'en','HOW_IT_WORKS__ITEM__CONVERT__TITLE','Convert','2018-07-15 21:00:43','2018-07-15 21:00:43'),(487,'en','ADVANTAGE__ITEM__TRUSTY__CONTENT','Trusty. We do not run the exchange — it is processed by the trusted platforms. Smartjex serve only as interface and compilation of these platforms.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(488,'en','HOW_IT_WORKS__ITEM__CONVERT__CONTENT','Set coin pair and choose the exchange platform, fill in your wallet’s addresses, send crypto — and just wait.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(489,'en','HOW_IT_WORKS__ITEM__TRACK__CONTENT','You can track the status of your exchange via the direct link to operation on Block Explorer. Also, we provide accurate feedback during the whole operation on the very page.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(490,'en','SEO__SECTION__TITLE','Exchange cryptocurrency','2018-07-15 21:00:43','2018-07-15 21:00:43'),(491,'en','ADVANTAGE__ITEM__FAST__TITLE','Fast','2018-07-15 21:00:43','2018-07-15 21:00:43'),(492,'en','FAQ__QUESTION__8','What does  “in USD” mean?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(493,'en','REVIEWS__SECTION__TITLE','Reviews','2018-07-15 21:00:43','2018-07-15 21:00:43'),(494,'en','FAQ__ANSWER__8','You can set the estimated amount you want to exchange in US dollars (USD). We will recalculate it in crypto.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(495,'en','ADVANTAGE__ITEM__FAIR__CONTENT','There is no hidden exchange fees – you pay just the platforms’ fee, already included in the list (moreover, we will offer the best option!). And you are able to access %d coins & tokens, and get them directly to your wallet. To compare to a stock exchange, you pay both exchange and withdrawal fees.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(496,'en','FAQ__QUESTION__1','Ok, I want to exchange some cryptocurrency. Does it mean you will get access to my wallet?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(497,'en','FAQ__ANSWER__9','We suggest every possible way to exchange your crypto. If the platforms follow everything else except the primarily set amount, there will be a hint on how you can change it to include it in the platform, if you decide to.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(498,'en','FAQ__QUESTION__2','How  will I know that I am on the official site?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(499,'en','FAQ__QUESTION__10','Why are  different platforms offered every time?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(500,'en','FAQ__ANSWER__2','Look at the address bar: the official Smartjex site has a secure https://, security mark, and its one and only address is https://smartjex.com','2018-07-15 21:00:43','2018-07-15 21:00:43'),(501,'en','HOW_IT_WORKS__ITEM__COMPARE__CONTENT','Once you set the exchange pair, we do the rest: research, compare options and offer the best rates.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(502,'en','FAQ__QUESTION__11','How do you know when I sent you my coins?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(503,'en','FAQ__ANSWER__3','Our algorithms examine rates and fees according to the amount exchanged and compare  it to 4 platforms (exchanges, etc.) in order to calculate the best rate.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(504,'en','FAQ__ANSWER__11','We create a unique address for every demand. You will get the hash-code (encrypted details of the transaction) to check it on the blockchain if you wish.\nWe check and refresh the status every 60 seconds. As a rule, this is enough, but in rare cases it can take longer (3-4 checkups)','2018-07-15 21:00:43','2018-07-15 21:00:43'),(505,'en','FAQ__QUESTION__4','What is a “bottom offer”?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(506,'en','HOW_IT_WORKS__ITEM__TRACK__TITLE','Track','2018-07-15 21:00:43','2018-07-15 21:00:43'),(507,'en','FAQ__ANSWER__12','Yes, you can set the exchange deposit address and we will send your coins there. Go to Profile > Deposit/Withdrawals and choose the Deposit address for the selected currency.\nNotice that in this case the transaction could take longer.\nWe also suggest checking  the withdrawal limit for each coin because different exchanges have different rules on how much crypto can be exchanged. It is important for your holdings to not to be “held back”.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(508,'en','FAQ__QUESTION__5','What is a “minimum amount”?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(509,'en','FAQ__ANSWER__5','It is the lowest amount of the selected crypto you can exchange. Note that the amount is different for every coin/token. It depends on the transaction fee, the platforms’ specifications and fees, and your required quantity of the crypto.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(510,'en','FAQ__ANSWER__7','By giving different options we provide our users an overview of the state of things. Also to let them choose according to their preferences.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(511,'en','FAQ__ANSWER__13','Yes, you can, but be aware of additional fees and a prolonged period of time.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(512,'en','SEO__SECTION__CONTENT','The number of cryptocurrencies and methods of handling them are extremely diverse: at least, trading vs. holding-and-rebalancing approaches. As a rule, people exchange bitcoin and altcoins at a stock exchange, but if you are not a daytrader, the process becomes painful. A stock exchange requires registration. It is unsafe to store funds because there is no light wallet. You have to pay both exchange and withdrawal fees and there is no place where all the types of altcoins are listed. A smart solution to getting quick & safe access to various cryptos, and bypassing exchanges, is through a cryptoconverter. Allow us introduce Smartjex — a smart multiconverter which can exchange bitcoins or any crypto, calculates the best rates, and quickly send it directly to your wallet. Additionally, Smartjex offers a wider variety of altcoins because it is integrated through a set of trusty platforms. We want Smartjex to ease your “cryptostory!”','2018-07-15 21:00:43','2018-07-15 21:00:43'),(513,'en','FAQ__QUESTION__14','Tell me more about the fees','2018-07-15 21:00:43','2018-07-15 21:00:43'),(514,'en','FAQ__ANSWER__6','It means the margin between the bottom and the top offer, according to your demand.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(515,'en','FAQ__ANSWER__14','There are exchange platforms’ fees – the reward that a platform demands for its service. Smartjex examines all this data and comes up with the best overall option.\nАnd there are network fees which let the blockchain operate. You will see it directly in your account.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(516,'en','FAQ__QUESTION__7','Why do you offer different options if there is always the best one?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(517,'en','FAQ__QUESTION__9','What means “needs limit adjust”?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(518,'en','FAQ__ANSWER__1','No. You will receive an address and can send your cryptocurrency from there by yourself. Smartjex won’t demand any access.\nAnd you can never be too thorough: don’t your seed phrase, your private key and password to anybody!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(519,'en','FAQ__ANSWER__15','15-60 minutes overall, 30 minutes on average. ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(520,'en','FAQ__QUESTION__16','What if the rate changes during the operation?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(521,'en','FAQ__ANSWER__10','Some platforms don’t support chosen pairs or could be unavailable – we suggest only selected list, to save your time and money!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(522,'en','FAQ__QUESTION__3','How do you know the best rate?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(523,'en','FAQ__QUESTION__17','I calculated that I will receive one amount of crypto, but I got a slightly different amount – why?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(524,'en','FAQ__QUESTION__12','Can I get new coins sent directly to my exchange address?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(525,'en','FAQ__QUESTION__18','What is a refund address?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(526,'en','FAQ__ANSWER__4','It is the most unprofitable available offer. It helps you see the difference between it and the most profitable offer.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(527,'en','FAQ__ANSWER__18','It is the address where you store the coins you want to exchange. For example, if you have BTC and want to get DogeCoin (DOGE), your refund address will be your BTC address.\nIt is not necessary for it to be  the same address or wallet you send BTC from.\nIf something goes wrong and the operation is called off, we will send your initial cryptocurrency to this address. \nThere is an extremely low probability of this occurring, but to be safe, we provide a refund address..','2018-07-15 21:00:43','2018-07-15 21:00:43'),(528,'en','FAQ__QUESTION__13','Can I deposit coins from an exchange?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(529,'en','FAQ__QUESTION__19','What is a destination address?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(530,'en','FAQ__QUESTION__6','What does  “I save 25%” mean?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(531,'en','FAQ__QUESTION__20','What if I put the wrong address?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(532,'en','FAQ__ANSWER__20','We have the initial check for the address and to correlate with selected crypto currencies (e.g. Bitcoin Cash (BCC) address to start with its prefix, etc.), but if you make mistake, you risk sending your funds to a stranger or lose them in blockchain forever. This operation is irreversible.\nTo avoid mistakes, do not copy your address, but manually, use the “copy” button:\n[for example: https://d.pr/i/QYVCfy]','2018-07-15 21:00:43','2018-07-15 21:00:43'),(533,'en','FAQ__QUESTION__15','How long will the transaction take?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(534,'en','FAQ__QUESTION__21','Why can\'t I change the cryptocurrency’s destination during step three?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(535,'en','FAQ__ANSWER__21','Once you chose the desired pair, we show you the conditions and benefits. Since you accept it, we focus on the very transaction details so you won’t be confused by the extra data. Therefore, you will be able to fill in your addresses correctly.\nIf you want to exchange other cryptocurrencies, please visit the previous steps and make choice again.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(536,'en','FAQ__QUESTION__22','What is an “order ID”?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(537,'en','FAQ__ANSWER__16','We consider a ~10% safety margin to cover the possible rate volatility when a transaction in process. You will get 100% of the funds available  exchanged at the moment of transaction.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(538,'en','FAQ__ANSWER__22','It is the unique access address link to the operation report. You need it to check the status of the operation. You can also send the link to your email','2018-07-15 21:00:43','2018-07-15 21:00:43'),(539,'en','FAQ__QUESTION__23','Can I refresh the page or close my browser window?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(540,'en','FAQ__ANSWER__17','This is because of volatility. The rate is extremely volatile due to macroeconomic reasons. For example, Bitcoin (BTC) rate changes within 1% every second. Don’t buy the exact amount of crypto you need, but leave some room for error.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(541,'en','FAQ__ANSWER__23','Yes, you can, and it won’t affect anything. You can always reopen the summary step.\nIf you closed the tab by accident, but haven’t saved the link, the quickest way to restore it is to press SHIFT+CMD/CTRL+T.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(542,'en','FAQ__ANSWER__24','Once the cryptocurrency is sent, every transaction is written on blockchain and the information is stored there forever.\nA unique reference to the transaction called “hash” is created and you can track its status there.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(543,'en','FAQ__QUESTION__25','What does QR-code redeem?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(544,'en','FAQ__ANSWER__19','It is the address where you will receive coins after exchange is made. For example, if you have BTC and want to exchange it for  DOGE, your destination address would be your DOGE address.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(545,'en','FAQ__QUESTION__26','What if I send the crypto two times? ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(546,'en','FAQ__ANSWER__26','We will send you the exchanged amount twice, your money will not be lost.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(547,'en','FAQ__ANSWER__27','If you send more than you initially set, we will exchange all the funds.\nIf you send less than you initially set, but over the minimum, we will exchange the funds.\nIf you send less than the necessary minimum, the transaction won’t work and you’ll be refunded. Please, consider the announced minimum amount.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(548,'en','FAQ__QUESTION__28','How do I know the operation is complete?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(549,'en','CONVERTER__YOU__SEND','You send','2018-07-15 21:00:43','2018-07-15 21:00:43'),(550,'en','CONVERTER__YOU__GET','You get','2018-07-15 21:00:43','2018-07-15 21:00:43'),(551,'en','FAQ__QUESTION__24','What does “view on blockchain” mean?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(552,'en','CONVERTER__EXCHANGE__BUTTON','Exchange','2018-07-15 21:00:43','2018-07-15 21:00:43'),(553,'en','CONVERTER__EXCHANGE__OR__COMPARE','or compare','2018-07-15 21:00:43','2018-07-15 21:00:43'),(554,'en','FAQ__ANSWER__25','We create a unique address and a unique QR-code for every transaction.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(555,'en','CONVERTER__EXCHANGE__SAVED','saved','2018-07-15 21:00:43','2018-07-15 21:00:43'),(556,'en','EXCHANGE__PAGE__STEPS__OFFERS','Offers','2018-07-15 21:00:43','2018-07-15 21:00:43'),(557,'en','FAQ__QUESTION__27','What if I send a higher or lower amount of crypto than the one I originally stated?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(558,'en','EXCHANGE__PAGE__STEPS__SUMMARY','Summary','2018-07-15 21:00:43','2018-07-15 21:00:43'),(559,'en','CONVERTER__EXCHANGE__BY__FULL','Exchange by','2018-07-15 21:00:43','2018-07-15 21:00:43'),(560,'en','FAQ__ANSWER__28','You will see the “All done” status in the Summary page. Or you can check your brand-new coins/tokens in your wallet. As a rule, the exchange process takes about 15-60 min depending on the network load and selected platforms.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(561,'en','CONVERTER__EXCHANGE__REFUND','refund address','2018-07-15 21:00:43','2018-07-15 21:00:43'),(562,'en','CONVERTER__EXCHANGE__AGREE','I agree with the ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(563,'en','CONVERTER__RECENT__TRANSACTIONS','Recent transactions','2018-07-15 21:00:43','2018-07-15 21:00:43'),(564,'en','CONVERTER__EXCHANGE__BUTTON__SUBMIT','Check & exchange','2018-07-15 21:00:43','2018-07-15 21:00:43'),(