re nos partenaires d\'échange pour fournir les meilleures offres en ce qui concerne le montant, les frais et la vitesse, et leur permet d\'être traitées de manière anonyme directement à partir de votre porte-monnaie.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(647,'fr','ABOUT__MENU__ITEM','À propos de nous','2018-07-15 21:00:43','2018-07-15 21:00:43'),(648,'fr','ABOUT__META__TITLE','À propos de SMARTJEX','2018-07-15 21:00:43','2018-07-15 21:00:43'),(649,'fr','ABOUT__META__KEYWORDS','À propos de nous','2018-07-15 21:00:43','2018-07-15 21:00:43'),(650,'fr','ABOUT__PAGE__TITLE','À propos de nous','2018-07-15 21:00:43','2018-07-15 21:00:43'),(651,'fr','ABOUT__META__DESCRIPTION','SMARTJEX échange des bitcoins et beaucoup d\'autres crypto, calcule leurs meilleurs taux et envoie rapidement des assets déjà convertis directement dans votre portefeuille.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(652,'fr','ABOUT__PAGE__SUBTITLE','A propos du service','2018-07-15 21:00:43','2018-07-15 21:00:43'),(653,'fr','CONTACT_FORM__TITLE','Formulaire de contact','2018-07-15 21:00:43','2018-07-15 21:00:43'),(654,'fr','ABOUT__PAGE__CONTENT','Nous sommes une société indépendante avec une expérience pratique dans les cryptomarchés. Notre mission est de gérer la routine et de créer de nouvelles façons de mettre en œuvre la crypto-monnaie en mettant au point des produits basés sur la technologie blockchain. <br/> Nous soutenons les besoins du marché et essayons d\'offrir des solutions nouvelles ou améliorées à utiliser comme nouveau statu quo. .<br/> L\'année dernière a semblé être l\'année des altcoins. Ainsi, il est nécessaire d\'avoir un outil pour envoyer et recevoir facilement n\'importe quelle monnaie, convertie en une autre. C\'est pourquoi nous avons créé Smartjex - multiconverter, un projet crypto-spécialisé, conçu pour augmenter l\'échange de crypto-monnaie à de nouveaux niveaux de clarté et de confort. <br/> Smartjex échange des bitcoins et beaucoup d\'autres crypto, calcule leurs meilleurs taux et envoie rapidement des assets déjà convertis directement dans votre portefeuille. <br/> Smartjex se réfère aux plateformes d\'échange via leur API, il ne demande aucune donnée personnelle et a des frais transparents: <ul> <li> ses propres frais ne dépasseront pas 1% de la transaction. Les frais des plateformes sont généralement mentionnés sur leurs sites (nous reflétons quelle plate-forme est utilisée comme intermédiaire) - et tout cela est déjà inclus dans les tarifs proposés, de sorte que vous voyez la somme totale à l\'exception des frais de blockchain; </li> <li> les frais de blockchain indépendants sont indiqués dans votre portefeuille au cours de la transaction même. </li></ul> Restez à l\'écoute!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(655,'fr','CONTACT_FORM__EMAIL_FIELD__LABEL','E-mail','2018-07-15 21:00:43','2018-07-15 21:00:43'),(656,'fr','CONTACT_FORM__NAME_FIELD__LABEL','prénom','2018-07-15 21:00:43','2018-07-15 21:00:43'),(657,'fr','CONTACT_FORM__SUBJECT_FIELD__LABEL','Assujettir','2018-07-15 21:00:43','2018-07-15 21:00:43'),(658,'fr','CONTACT_FORM__MESSAGE_FIELD__LABEL','Entrez du texte...','2018-07-15 21:00:43','2018-07-15 21:00:43'),(659,'fr','CONTACT_FORM__SUBMIT_BTN__LABEL','Envoyer','2018-07-15 21:00:43','2018-07-15 21:00:43'),(660,'fr','PRIVACY__MENU__ITEM','Politique de confidentialité','2018-07-15 21:00:43','2018-07-15 21:00:43'),(661,'fr','PRIVACY__META__TITLE','Conditions d\'utilisation','2018-07-15 21:00:43','2018-07-15 21:00:43'),(662,'fr','PRIVACY__META__KEYWORDS','Conditions d\'utilisation','2018-07-15 21:00:43','2018-07-15 21:00:43'),(663,'fr','PRIVACY__META__DESCRIPTION','Conditions d\'utilisation','2018-07-15 21:00:43','2018-07-15 21:00:43'),(664,'fr','PRIVACY__PAGE__TITLE','Titre de la page de confidentialité','2018-07-15 21:00:43','2018-07-15 21:00:43'),(665,'fr','PRIVACY__PAGE__SUBTITLE','Sous-titre de la page de confidentialité','2018-07-15 21:00:43','2018-07-15 21:00:43'),(666,'fr','PRIVACY__PAGE__CONTENT','Smartjex.com («smartjex.com» ou «nous») contrôle et donne accès au site Web smartjex.com, actuellement situé sur www.smartjex.com (le «site Web»). Chez smartjex.com, nous nous engageons à respecter votre vie privée et à protéger toute information fournie par nos clients. Votre vie privée et votre sécurité sont des priorités absolues et nous mettons tout en œuvre pour assurer la protection de toutes les informations que vous nous fournissez. Cette politique de confidentialité (la «Politique») est conçue pour vous informer des conditions de traitement de vos données personnelles.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(667,'fr','PRIVACY__PAGE__PERSONAL__TITLE','## Informations personnelles','2018-07-15 21:00:43','2018-07-15 21:00:43'),(668,'fr','PRIVACY__PAGE__PERSONAL','Pour accéder aux fonctionnalités du site, vous devez vous inscrire. Lors de l\'inscription, il vous sera demandé de fournir une adresse e-mail et de créer un mot de passe. Vous pouvez également choisir de créer un lien vers le site Web en utilisant l\'un de vos comptes sur les réseaux sociaux, tels que Twitter, Facebook et Google+.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(669,'fr','PRIVACY__PAGE__RECORD__TITLE','## Collection de disques','2018-07-15 21:00:43','2018-07-15 21:00:43'),(670,'fr','PRIVACY__PAGE__RECORD__CONTENT','Dès que vous vous inscrivez sur smartjex.com, notre logiciel commencera à collecter vos informations d\'identification non personnelles. Ces informations peuvent inclure le nom de votre navigateur et des informations techniques sur vos moyens de connexion à notre site Web, en particulier le système d\'exploitation et les fournisseurs de services Internet utilisés entre autres informations similaires.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(671,'fr','PRIVACY__PAGE__CONTACT__TITLE','## Nous contacter','2018-07-15 21:00:43','2018-07-15 21:00:43'),(672,'fr','PRIVACY__PAGE__CONTACT__CONTENT','Si vous avez des questions concernant cette politique de confidentialité ou les règles de smartjex.com, veuillez nous contacter à: [support@smartjex.com] (mailto: support@smartjex.com)','2018-07-15 21:00:43','2018-07-15 21:00:43'),(673,'fr','TERMS__MENU__ITEM','Conditions d\'utilisation et politique de confidentialité','2018-07-15 21:00:43','2018-07-15 21:00:43'),(674,'fr','TERMS__META__TITLE','Conditions d\'utilisation','2018-07-15 21:00:43','2018-07-15 21:00:43'),(675,'fr','TERMS__META__KEYWORDS','termes, confidentialité','2018-07-15 21:00:43','2018-07-15 21:00:43'),(676,'fr','TERMS__META__DESCRIPTION','Conditions d\'utilisation meta description','2018-07-15 21:00:43','2018-07-15 21:00:43'),(677,'fr','TERMS__PAGE__TITLE','Conditions d\'utilisation','2018-07-15 21:00:43','2018-07-15 21:00:43'),(678,'fr','TERMS__PAGE__SUBTITLE','Conditions détaillées','2018-07-15 21:00:43','2018-07-15 21:00:43'),(679,'fr','TERMS__PAGE__CONTENT','Smartjex.com est un site web et une plate-forme en ligne qui permet l\'échange crypto-monnaie, c\'est-à-dire l\'échange de monnaie numérique non réglementée, émis et généralement contrôlé par ses développeurs, utilisé et accepté parmi les membres de communautés virtuelles spécifiques, y compris limité à Bitcoin, NEO, Ether, Litecoin, Ripple, Dash, etc. en utilisant le meilleur taux de change.\nEn utilisant le site Web https://smartjex.com/ et en acceptant de bénéficier des services offerts par le site Web («Service»), vous acceptez d\'accepter et de respecter les modalités et conditions d\'utilisation énoncées ci-dessous («Conditions utile\").\nEn accédant au site Web, vous acceptez d\'être lié par nos Conditions et toutes les lois, règles et réglementations applicables, et que vous êtes responsable de votre respect de celles-ci et que vous respectez toutes les lois, règles et réglementations applicables. Si vous n\'êtes pas d\'accord avec l\'une de nos conditions, vous devez cesser d\'utiliser le site Web. Toute utilisation du Site implique votre acceptation réputée de nos Conditions.\nSmartjex se réserve le droit d\'apporter des modifications à notre site, à nos politiques et à nos conditions d\'utilisation à tout moment. Le contenu des pages du site Web est pour votre information générale et utilisation seulement. Un changement sans préavis est possible.\nEn utilisant le Site, vous déclarez être âgé d\'au moins 18 ans et avoir pleinement le droit de contracter conformément à la loi applicable, en respectant et en respectant toutes les lois, règles et réglementations applicables de votre pays de résidence et du domaine de compétence de Smartjex. Législation\").\nLes présentes Conditions d\'utilisation, la Déclaration de confidentialité et de confidentialité (les «Conditions») et tous les autres accords entre Smartjex et ses utilisateurs utiliseront les définitions suivantes:\nune. \"Client\", \"utilisateur\", \"client\", \"vous\" et \"notre\" désignent la personne ou l\'entité qui accède et / ou utilise Smartjex.\nb. «Entreprise», «Smartjex», «Site Web», «Service», «nous» et «nous» désignent collectivement le site Web en ligne et tous les produits utilisant l\'API Smartjex, ses propriétaires, administrateurs, dirigeants, employés, opérateurs, agents, assureurs, fournisseurs et avocats.\nré. «Actif», «actif numérique», «monnaie», «monnaie fiduciaire», «fonds», «bien», «entrée de grand livre» et «jeton» désignent collectivement la monnaie numérique non réglementée, qui est émise et généralement contrôlée par ses développeurs, et utilisés et acceptés parmi les membres de communautés virtuelles spécifiques, y compris, mais sans s\'y limiter, Bitcoin, NEO, Ether, Litecoin, Ripple, Dash, etc.\ne. \"Partenaires\" sont des services que Smartjex utilise pour effectuer des opérations d\'échange, ils sont listés dans le pied de page du Site;','2018-07-15 21:00:43','2018-07-15 21:00:43'),(680,'fr','TERMS__PAGE__CONTENT__FOOTER','1. Smartjex n\'est ni le créateur ni l\'administrateur d\'une crypto-monnaie. Il agit simplement comme un agrégateur et un intermédiaire entre l\'utilisateur et les différents partenaires à travers le monde via des sites Web externes.\n2.Le service fourni par Smartjex permet à tous les utilisateurs du site Web d\'échanger des cryptomonnaies directement à d\'autres cryptomonnaies à partir de divers échanges de devises virtuelles.\n3.Smartjex offre des services d\'information intermédiaires aux utilisateurs. Nous ne servons que d\'interface et de compilation de plateformes. Les transactions financières sont effectuées par des partenaires.\n4.Smartjex vous accorde une licence révocable non exclusive non transférable limitée pour utiliser le Service gratuitement.\n5.Smartjex prend un frais d\'échange pour l\'utilisation du service. Les frais sont de 1% de la transaction. Les frais peuvent être soumis à des fluctuations raisonnables en raison de l\'arrondissement mathématique. Les frais sont déjà inclus dans les offres listées. Les frais de blockchain indépendants ne sont pas inclus dans la somme totale, vous pouvez les vérifier dans votre portefeuille pendant la transaction même.\n6.Smartjex a le droit de refuser des opérations et de ne pas rembourser vos biens si vous violez les termes ou la législation.\n7. Vous acceptez d\'utiliser vos propres portefeuilles numériques, leurs adresses (\"Portefeuille\") et vos Actifs. Vous ne devez pas utiliser le portefeuille ou les actifs de quelqu\'un d\'autre.\n8. Il vous est interdit d\'utiliser ou d\'accéder à Smartjex de manière abusive. Ceci peut inclure, sans limitation et à la seule discrétion de Smartjex, la soumission de transactions ou d\'autres données qui imposent une charge déraisonnable ou incontrôlable sur la plate-forme Smartjex, qu\'elle interfère ou non avec les opérations normales.\n9.Smartjex n\'est pas responsable de la modification du taux de change en raison de la volatilité du marché. Nous fixons le taux de change au moment de l\'envoi, précis à 90 min. Nous prenons les données des sites suivants via leur API. Nous ne pouvons pas prédire combien de temps la transaction prendra et ne pouvons pas indiquer le montant final des Actifs que vous recevrez.\n10.Smartjex retournera vos Actifs initiaux sur le Portefeuille déclaré si l\'opération d\'échange ne passe pas dans la période de 90 minutes.\n11.Vous ne pouvez pas annuler l\'opération après avoir transféré de l\'argent de votre portefeuille.\n12. Aucune donnée précieuse n\'est collectée, stockée par Smartjex ou transmise à des entités tierces.\n13.Smartjex n\'exploite pas, n\'effectue pas d\'opérations commerciales et n\'effectue pas d\'opérations commerciales avec de l\'argent fiduciaire. Nous n\'exploitons, n\'effectuons et n\'effectuons que des opérations commerciales liées à des actifs crypto-actifs.\n14. Aucun commentaire, avis, article, critique ou autre support écrit ou audio sur le Site, le blog ou tout autre projet utilisant le code de Smartjex ne doit être considéré comme un conseil financier officiel ou certifié ou une recommandation d\'investissement. Smartjex n\'est pas responsable de la sécurité des pièces et des jetons offerts par les partenaires.\n15. Les utilisateurs sont responsables de l\'exactitude de la spécification de leurs données, y compris, mais sans s\'y limiter, les adresses de portefeuille et les spécifications des actifs. Sinon, Smartjex ne pourra pas retourner, transférer et effectuer d\'autres transactions.\n16.Smartjex prend une décision unilatérale concernant le remboursement des fonds et le taux de remboursement. Vous ne pouvez pas faire appel contre cela.\n17.Smartjex n\'est pas responsable des pertes, dommages ou dommages résultant de l\'accès à toute représentation erronée du site ou des services connexes par des entités non affiliées se présentant intentionnellement ou involontairement comme étant liées ou liées au site. Nous vous conseillons de vérifier que l\'adresse Web est https://smartjex.com/\n18. Tous les désaccords et obligations juridiques sont résolus conformément aux lois et à la législation de la République de Chypre.\n19.Smartjex n\'est pas responsable de toute perte, causée par une raison quelconque, tout en travaillant avec l\'échange. Toute perte causée par des activités de tiers doit être résolue par l\'utilisateur.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(681,'fr','CURRENCIES__MENU__ITEM','Monnaies prises en charge','2018-07-15 21:00:43','2018-07-15 21:00:43'),(682,'fr','CURRENCIES__META__TITLE','Exchange pris en charge les devises | SMARTJEX','2018-07-15 21:00:43','2018-07-15 21:00:43'),(683,'fr','CURRENCIES__META__KEYWORDS','Exchange pris en charge les devises','2018-07-15 21:00:43','2018-07-15 21:00:43'),(684,'fr','CURRENCIES__META__DESCRIPTION','Monnaies prises en charge pour la conversation','2018-07-15 21:00:43','2018-07-15 21:00:43'),(685,'fr','CURRENCIES__PAGE__TITLE','Monnaies prises en charge','2018-07-15 21:00:43','2018-07-15 21:00:43'),(686,'fr','CURRENCIES__PAGE__SUBTITLE','Maintenant, nous soutenons plus de %d cryptocurrencies à échanger sur tous les principaux échanges','2018-07-15 21:00:43','2018-07-15 21:00:43'),(687,'fr','CURRENCIES__SEARCH_FIELD__PLACEHOLDER','Rechercher des devises','2018-07-15 21:00:43','2018-07-15 21:00:43'),(688,'fr','CURRENCIES__TABLE__COLUMN__NAME_AND_SYMBOL','Nom & Ticker','2018-07-15 21:00:43','2018-07-15 21:00:43'),(689,'fr','CURRENCIES__TABLE__COLUMN__RATE','Taux','2018-07-15 21:00:43','2018-07-15 21:00:43'),(690,'fr','CURRENCIES__TABLE__COLUMN__1_HOUR_CHANGES','1h','2018-07-15 21:00:43','2018-07-15 21:00:43'),(691,'fr','CURRENCIES__TABLE__COLUMN__24_HOURS_CHANGES','24h','2018-07-15 21:00:43','2018-07-15 21:00:43'),(692,'fr','CURRENCIES__TABLE__COLUMN__7_DAYS_CHANGES','7 jours','2018-07-15 21:00:43','2018-07-15 21:00:43'),(693,'fr','FAQ__MENU__ITEM','FAQ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(694,'fr','CURRENCIES__TABLE__EXCHANGE_BUTTON','Échange %s','2018-07-15 21:00:43','2018-07-15 21:00:43'),(695,'fr','FAQ__META__TITLE','FAQ: Questions et réponses de base | SMARTJEX','2018-07-15 21:00:43','2018-07-15 21:00:43'),(696,'fr','FAQ__META__KEYWORDS','FAQ, questions et réponses de base','2018-07-15 21:00:43','2018-07-15 21:00:43'),(697,'fr','FAQ__META__DESCRIPTION','Trouvez des réponses à vos questions sur les échanges de crypto-mon','2018-07-15 21:00:43','2018-07-15 21:00:43'),(698,'fr','FAQ__PAGE__TITLE','FAQ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(699,'fr','FAQ__PAGE__SUBTITLE','Questions et réponses de base','2018-07-15 21:00:43','2018-07-15 21:00:43'),(700,'fr','FAQ__HAVE_QUESTION__TITLE','Votre problème n\'est pas répertorié ici?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(701,'fr','FAQ__HAVE_QUESTION__CONTENT','Vous avez un problème ou une question sur notre service?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(702,'fr','FAQ__HAVE_QUESTION__CONTACT_BUTTON','Rejoins-nous','2018-07-15 21:00:43','2018-07-15 21:00:43'),(703,'fr','FAQ__SECTION__STEP_1__TITLE','Étape 1. Offres','2018-07-15 21:00:43','2018-07-15 21:00:43'),(704,'fr','FAQ__SECTION__STEP_2__TITLE','Étape 2. Détails','2018-07-15 21:00:43','2018-07-15 21:00:43'),(705,'fr','FAQ__SECTION__STEP_3__TITLE','Étape 3. Résumé','2018-07-15 21:00:43','2018-07-15 21:00:43'),(706,'fr','TRACK_ORDER__SUBMIT_BTN','Piste','2018-07-15 21:00:43','2018-07-15 21:00:43'),(707,'fr','TRACK_ORDER__MENU_ITEM','Suivi de commande','2018-07-15 21:00:43','2018-07-15 21:00:43'),(708,'fr','ADVANTAGE__ITEM__TRUSTY__TITLE','Sûr','2018-07-15 21:00:43','2018-07-15 21:00:43'),(709,'fr','ADVANTAGE__ITEM__ANONYMOUS__CONTENT','Nous ne demandons ni ne stockons vos données personnelles. Tout ce dont nous avons besoin est l\'adresse de votre portefeuille pour les pièces cibles.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(710,'fr','ADVANTAGE__ITEM__ANONYMOUS__TITLE','Anonyme','2018-07-15 21:00:43','2018-07-15 21:00:43'),(711,'fr','ADVANTAGE__ITEM__FAST__CONTENT','Simple processus en trois étapes: 1) choisir la cryptomonnaie nécessaire, 2) remplir l\'adresse du portefeuille, 3) envoyer le crypto initial à un portefeuille donné. C\'est tout!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(712,'fr','ADVANTAGE__ITEM__FAIR__TITLE','Juste','2018-07-15 21:00:43','2018-07-15 21:00:43'),(713,'fr','TRACK_ORDER__INPUT_PLACEHOLDER','Entrez l\'identifiant de la commande','2018-07-15 21:00:43','2018-07-15 21:00:43'),(714,'fr','PARTNERS__SECTION__TITLE','Nos partenaires','2018-07-15 21:00:43','2018-07-15 21:00:43'),(715,'fr','HOW_IT_WORKS__SECTION__TITLE','Comment ça marche','2018-07-15 21:00:43','2018-07-15 21:00:43'),(716,'fr','HOW_IT_WORKS__ITEM__COMPARE__TITLE','Choisir','2018-07-15 21:00:43','2018-07-15 21:00:43'),(717,'fr','ADVANTAGE__SECTION__TITLE','Avantages','2018-07-15 21:00:43','2018-07-15 21:00:43'),(718,'fr','HOW_IT_WORKS__ITEM__CONVERT__TITLE','Convertir','2018-07-15 21:00:43','2018-07-15 21:00:43'),(719,'fr','ADVANTAGE__ITEM__TRUSTY__CONTENT','Sûr. Nous n\'exécutons pas l\'échange - il est traité par les plateformes de confiance. Smartjex sert uniquement d\'interface et de compilation de ces plateformes.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(720,'fr','HOW_IT_WORKS__ITEM__CONVERT__CONTENT','Réglez la paire de pièces et choisissez la plate-forme d\'échange, remplissez les adresses de votre portefeuille, envoyez des crypto - et attendez.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(721,'fr','HOW_IT_WORKS__ITEM__TRACK__CONTENT','Vous pouvez suivre l\'état de votre échange via le lien direct vers l\'opération sur Block Explorer. En outre, nous fournissons des commentaires précis pendant toute l\'opération sur la page même.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(722,'fr','SEO__SECTION__TITLE','Crypto-monnaie d\'échange','2018-07-15 21:00:43','2018-07-15 21:00:43'),(723,'fr','ADVANTAGE__ITEM__FAST__TITLE','Vite','2018-07-15 21:00:43','2018-07-15 21:00:43'),(724,'fr','REVIEWS__SECTION__TITLE','Avis','2018-07-15 21:00:43','2018-07-15 21:00:43'),(725,'fr','ADVANTAGE__ITEM__FAIR__CONTENT','Il n\'y a pas de frais d\'échange cachés - vous ne payez que les frais des plateformes, déjà inclus dans la liste (de plus, nous vous offrirons la meilleure option!). Et vous êtes en mesure d\'accéder à %d pièces et jetons, et les obtenir directement à votre porte-monnaie. Pour comparer à une bourse, vous payez des frais d\'échange et de retrait.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(726,'fr','FAQ__QUESTION__1','Ok, je veux échanger de la crypto-monnaie. Cela signifie-t-il que vous aurez accès à mon portefeuille?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(727,'fr','FAQ__QUESTION__2','Comment saurai-je que je suis sur le site officiel?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(728,'fr','FAQ__ANSWER__2','Regardez la barre d\'adresse: le site officiel de Smartjex a une marque de sécurité https: //, et sa seule et unique adresse est https://smartjex.com','2018-07-15 21:00:43','2018-07-15 21:00:43'),(729,'fr','HOW_IT_WORKS__ITEM__COMPARE__CONTENT','Une fois que vous avez défini la paire d\'échange, nous faisons le reste: recherchez, comparez les options et offrez les meilleurs taux.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(730,'fr','FAQ__ANSWER__3','Nos algorithmes examinent les tarifs et les frais selon le montant échangé et le comparent à 4 plateformes (échanges, etc.) afin de calculer le meilleur taux.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(731,'fr','FAQ__QUESTION__4','Qu\'est-ce qu\'une \"offre de base\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(732,'fr','HOW_IT_WORKS__ITEM__TRACK__TITLE','Piste','2018-07-15 21:00:43','2018-07-15 21:00:43'),(733,'fr','FAQ__QUESTION__5','Qu\'est-ce qu\'un \"montant minimum\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(734,'fr','FAQ__ANSWER__5','C\'est la plus petite quantité de crypto sélectionnée que vous pouvez échanger. Notez que le montant est différent pour chaque pièce / jeton. Cela dépend des frais de transaction, des spécifications et des frais des plateformes, et de la quantité requise de crypto.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(735,'fr','SEO__SECTION__CONTENT','Le nombre de crypto-monnaies et les méthodes pour les gérer sont extrêmement variés: du moins, des approches de négociation et de rétention-rééquilibrage. En règle générale, les gens échangent des bitcoins et des altcoins à une bourse, mais si vous n\'êtes pas un daytrader, le processus devient douloureux. Une bourse doit être enregistrée. Il est dangereux de stocker des fonds parce qu\'il n\'y a pas de portefeuille léger. Vous devez payer des frais d\'échange et de retrait et il n\'y a aucun endroit où tous les types d\'altcoins sont listés. Une solution intelligente pour accéder rapidement et en toute sécurité à divers cryptos, et contourner les échanges, passe par un cryptoconvertisseur. Permettez-nous de présenter Smartjex - un multiconvertisseur intelligent qui peut échanger des bitcoins ou n\'importe quelle crypto, calcule les meilleurs taux, et l\'envoie rapidement directement à votre porte-monnaie. En outre, Smartjex offre une plus grande variété d\'altcoins parce qu\'il est intégré à travers un ensemble de plates-formes fiables. Nous voulons que Smartjex facilite votre \"cryptostory!\"','2018-07-15 21:00:43','2018-07-15 21:00:43'),(736,'fr','FAQ__ANSWER__6','Cela signifie la marge entre l\'offre inférieure et supérieure, selon votre demande.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(737,'fr','FAQ__QUESTION__7','Pourquoi proposez-vous différentes options s\'il y en a toujours la meilleure?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(738,'fr','FAQ__ANSWER__1','Non. Vous recevrez une adresse et pourrez envoyer votre crypto-monnaie par vous-même. Smartjex ne demandera aucun accès.\nEt vous ne pouvez jamais être trop minutieux: ne donnez pas votre mot de passe, votre clé privée et votre mot de passe à qui que ce soit!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(739,'fr','FAQ__QUESTION__8','Que signifie \"en USD\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(740,'fr','FAQ__ANSWER__8','Vous pouvez définir le montant estimé que vous souhaitez échanger en dollars américains (USD). Nous allons le recalculer en crypto.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(741,'fr','FAQ__QUESTION__3','Vous pouvez définir le montant estimé que vous voulez en dollars américains (USD). Nous allons le recalculer en crypto.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(742,'fr','FAQ__ANSWER__9','Nous suggérons tous les moyens possibles pour échanger votre crypto. Si les plates-formes suivent tout le reste, à l\'exception du montant défini en premier, il y aura un indice sur la façon dont vous pouvez le modifier pour l\'inclure dans la plateforme, si vous décidez de le faire.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(743,'fr','FAQ__QUESTION__10','Pourquoi différentes plates-formes sont-elles proposées à chaque fois?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(744,'fr','FAQ__ANSWER__4','C\'est l\'offre disponible la moins rentable. Cela vous aide à voir la différence entre cette offre et l\'offre la plus rentable.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(745,'fr','FAQ__QUESTION__11','Comment savez-vous quand je vous ai envoyé mes pièces de monnaie?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(746,'fr','FAQ__ANSWER__11','Nous créons une adresse unique pour chaque demande. Vous obtiendrez le code de hachage (détails cryptés de la transaction) pour le vérifier sur la blockchain si vous le souhaitez.\nNous vérifions et actualisons l\'état toutes les 60 secondes. En règle générale, cela suffit, mais dans de rares cas, cela peut prendre plus de temps (3-4 contrôles)','2018-07-15 21:00:43','2018-07-15 21:00:43'),(747,'fr','FAQ__QUESTION__6','Que signifie \"j\'épargne 25%\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(748,'fr','FAQ__ANSWER__12','Oui, vous pouvez définir l\'adresse de dépôt et nous vous enverrons vos pièces de monnaie. Allez dans Profil> Dépôts / retraits et choisissez l\'adresse de dépôt pour la devise sélectionnée.\nNotez que dans ce cas, la transaction pourrait prendre plus de temps.\nNous vous suggérons également de vérifier la limite de retrait pour chaque pièce de monnaie parce que les différents échanges ont des règles différentes sur la quantité de crypto pouvant être échangée. Il est important que vos fonds ne soient pas «retenus».','2018-07-15 21:00:43','2018-07-15 21:00:43'),(749,'fr','FAQ__ANSWER__7','En donnant différentes options, nous fournissons à nos utilisateurs un aperçu de l\'état des choses. Aussi pour les laisser choisir en fonction de leurs préférences.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(750,'fr','FAQ__ANSWER__13','Oui, vous le pouvez, mais soyez conscient des frais supplémentaires et d\'une période de temps prolongée.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(751,'fr','FAQ__QUESTION__14','Dites-m\'en plus sur les frais','2018-07-15 21:00:43','2018-07-15 21:00:43'),(752,'fr','FAQ__ANSWER__14','Il y a des frais de plate-forme d\'échange - la récompense qu\'une plate-forme exige pour son service. Smartjex examine toutes ces données et propose la meilleure option globale.\nEt il y a des frais de réseau qui permettent à la blockchain de fonctionner. Vous le verrez directement dans votre compte.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(753,'fr','FAQ__QUESTION__9','Qu\'est-ce que signifie «besoin de limiter la limite»?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(754,'fr','FAQ__ANSWER__15','15-60 minutes au total, 30 minutes en moyenne.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(755,'fr','FAQ__QUESTION__16','Que faire si le taux change pendant l\'opération?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(756,'fr','FAQ__ANSWER__10','Certaines plates-formes ne supportent pas les paires choisies ou pourraient être indisponibles - nous suggérons seulement la liste sélectionnée, pour économiser votre temps et votre argent!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(757,'fr','FAQ__QUESTION__17','J\'ai calculé que je vais recevoir une quantité de crypto, mais j\'ai un montant légèrement différent - pourquoi?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(758,'fr','FAQ__QUESTION__12','Puis-je recevoir de nouvelles pièces directement à mon adresse d\'échange?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(759,'fr','FAQ__QUESTION__18','Qu\'est-ce qu\'une adresse de remboursement?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(760,'fr','FAQ__ANSWER__18','C\'est l\'adresse où vous stockez les pièces que vous voulez échanger. Par exemple, si vous avez BTC et que vous voulez obtenir DogeCoin (DOGE), votre adresse de remboursement sera votre adresse BTC.\nIl n\'est pas nécessaire que ce soit la même adresse ou le même portefeuille que celui que vous envoyez.\nSi quelque chose se passe mal et que l\'opération est annulée, nous enverrons votre crypto-monnaie initiale à cette adresse.\nIl y a une très faible probabilité que cela se produise, mais pour être sûr, nous fournissons une adresse de remboursement.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(761,'fr','FAQ__QUESTION__13','Puis-je déposer des pièces d\'un échange?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(762,'fr','FAQ__QUESTION__19','Qu\'est-ce qu\'une adresse de destination?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(763,'fr','FAQ__QUESTION__20','Que faire si je mets la mauvaise adresse?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(764,'fr','FAQ__ANSWER__20','Nous avons la vérification initiale de l\'adresse et corréler avec les devises crypto sélectionnées (par exemple l\'adresse Bitcoin Cash (BCC) pour commencer avec son préfixe, etc.), mais si vous faites une erreur, vous risquez d\'envoyer vos fonds à un étranger ou de les perdre en blockchain pour toujours. Cette opération est irréversible.\nPour éviter les erreurs, ne copiez pas votre adresse, mais manuellement, utilisez le bouton \"copier\":\n[par exemple: https://d.pr/i/QYVCfy]','2018-07-15 21:00:43','2018-07-15 21:00:43'),(765,'fr','FAQ__QUESTION__15','Combien de temps prendra la transaction?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(766,'fr','FAQ__QUESTION__21','Pourquoi ne puis-je pas changer la destination de la crypto-monnaie au cours de la troisième étape?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(767,'fr','FAQ__ANSWER__21','Une fois que vous avez choisi la paire désirée, nous vous montrons les conditions et les avantages. Puisque vous l\'acceptez, nous nous concentrons sur les détails de la transaction afin que vous ne soyez pas dérouté par les données supplémentaires. Par conséquent, vous serez en mesure de remplir vos adresses correctement.\nSi vous souhaitez échanger d\'autres cryptocurrences, veuillez visiter les étapes précédentes et refaire votre choix.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(768,'fr','FAQ__ANSWER__16','Nous considérons une marge de sécurité de ~ 10% pour couvrir la volatilité de taux possible lors d\'une transaction en cours. Vous obtiendrez 100% des fonds disponibles échangés au moment de la transaction.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(769,'fr','FAQ__QUESTION__22','Qu\'est-ce qu\'un \"identifiant de commande\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(770,'fr','FAQ__ANSWER__22','C\'est le lien unique d\'adresse d\'accès au rapport d\'opération. Vous en avez besoin pour vérifier l\'état de l\'opération. Vous pouvez également envoyer le lien vers votre email','2018-07-15 21:00:43','2018-07-15 21:00:43'),(771,'fr','FAQ__QUESTION__23','Puis-je actualiser la page ou fermer la fenêtre de mon navigateur?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(772,'fr','FAQ__ANSWER__17','C\'est à cause de la volatilité. Le taux est extrêmement volatile pour des raisons macroéconomiques. Par exemple, les taux de Bitcoin (BTC) changent à moins de 1% toutes les secondes. N\'achetez pas la quantité exacte de crypto dont vous avez besoin, mais laissez une marge d\'erreur.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(773,'fr','FAQ__ANSWER__23','Oui, vous pouvez, et cela n\'affectera rien. Vous pouvez toujours rouvrir l\'étape de résumé.\nSi vous avez fermé l\'onglet par accident, mais que vous n\'avez pas enregistré le lien, le moyen le plus rapide de le restaurer consiste à appuyer sur MAJ + CMD / CTRL + T.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(774,'fr','FAQ__ANSWER__24','Une fois la crypto-monnaie envoyée, chaque transaction est écrite sur blockchain et les informations y sont stockées pour toujours.\nUne référence unique à la transaction appelée \"hash\" est créée et vous pouvez en suivre le statut.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(775,'fr','FAQ__QUESTION__25','Qu\'est-ce que le code QR rachète?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(776,'fr','FAQ__ANSWER__19','C\'est l\'adresse où vous recevrez des pièces après l\'échange. Par exemple, si vous avez BTC et que vous voulez l\'échanger contre DOGE, votre adresse de destination sera votre adresse DOGE.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(777,'fr','FAQ__QUESTION__26','Et si j\'envoie le crypto deux fois?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(778,'fr','FAQ__ANSWER__26','Nous vous enverrons le montant échangé deux fois, votre argent ne sera pas perdu.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(779,'fr','FAQ__ANSWER__27','Si vous envoyez plus que ce que vous avez initialement défini, nous échangerons tous les fonds.\nSi vous envoyez moins que ce que vous avez initialement fixé, mais au-dessus du minimum, nous échangerons les fonds.\nSi vous envoyez moins que le minimum nécessaire, la transaction ne fonctionnera pas et vous serez remboursé. S\'il vous plaît, considérez le montant minimum annoncé.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(780,'fr','FAQ__QUESTION__28','Comment puis-je savoir que l\'opération est terminée?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(781,'fr','CONVERTER__YOU__SEND','Vous envoyez','2018-07-15 21:00:43','2018-07-15 21:00:43'),(782,'fr','CONVERTER__YOU__GET','Vous obtenez','2018-07-15 21:00:43','2018-07-15 21:00:43'),(783,'fr','FAQ__QUESTION__24','Que signifie \"voir sur blockchain\"?','2018-07-15 21:00:43','2018-07-15 