rto, commissioni e velocità e consente loro di effettuare transazioni anonime direttamente dal tuo portafoglio.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(879,'it','ABOUT__MENU__ITEM','Riguardo a noi','2018-07-15 21:00:43','2018-07-15 21:00:43'),(880,'it','ABOUT__META__TITLE','Informazioni su SMARTJEX','2018-07-15 21:00:43','2018-07-15 21:00:43'),(881,'it','ABOUT__META__KEYWORDS','Riguardo a noi','2018-07-15 21:00:43','2018-07-15 21:00:43'),(882,'it','ABOUT__META__DESCRIPTION','SMARTJEX scambia bitcoin e molti altri crypto, calcola le loro migliori tariffe e invia rapidamente asset già convertiti direttamente nel tuo portafoglio.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(883,'it','ABOUT__PAGE__TITLE','Riguardo a noi','2018-07-15 21:00:43','2018-07-15 21:00:43'),(884,'it','ABOUT__PAGE__SUBTITLE','Informazioni sul servizio','2018-07-15 21:00:43','2018-07-15 21:00:43'),(885,'it','ABOUT__PAGE__CONTENT','Siamo una società indipendente con esperienza pratica in cryptomarkets. La nostra missione è occuparsi della routine e creare nuovi modi per implementare la criptovaluta con lo sviluppo di prodotti basati su blockchain. <br/>Sosteniamo le esigenze del mercato e cerchiamo di offrire soluzioni nuove o aggiornate da utilizzare come nuovo status quo.<br/>L\'anno scorso sembrava essere l\'anno di altcoins. Pertanto, è necessario disporre di uno strumento per inviare e ricevere facilmente qualsiasi valuta, convertito l\'uno nell\'altro. Per questo motivo abbiamo creato Smartjex - multiconverter, un progetto cripto-specializzato, progettato per aumentare lo scambio di criptovalute a nuovi livelli di chiarezza e comfort.<br/>Smartjex scambia bitcoin e molti altri crypto, calcola le loro migliori tariffe e invia rapidamente asset già convertiti direttamente nel tuo portafoglio.<br/>Smartjex si riferisce alle piattaforme di scambio tramite le loro API, non richiede alcun dato personale e ha tariffe trasparenti:<ul><li>la sua commissione non supererà l\'1% della transazione. Le tariffe delle piattaforme sono di solito menzionate nei loro siti (riflettiamo su quale piattaforma viene utilizzata come intermediario) - e tutto questo è già incluso nelle tariffe offerte, quindi si vede la somma totale eccetto la commissione blockchain;</li> <li>le spese di blockchain indipendenti sono mostrate nel tuo portafoglio durante la transazione stessa..</li></ul> Rimanete sintonizzati!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(886,'it','CONTACT_FORM__TITLE','Modulo di Contatto','2018-07-15 21:00:43','2018-07-15 21:00:43'),(887,'it','CONTACT_FORM__EMAIL_FIELD__LABEL','E-mail','2018-07-15 21:00:43','2018-07-15 21:00:43'),(888,'it','CONTACT_FORM__NAME_FIELD__LABEL','Nome','2018-07-15 21:00:43','2018-07-15 21:00:43'),(889,'it','CONTACT_FORM__SUBJECT_FIELD__LABEL','Soggetto','2018-07-15 21:00:43','2018-07-15 21:00:43'),(890,'it','CONTACT_FORM__MESSAGE_FIELD__LABEL','Inserire il testo...','2018-07-15 21:00:43','2018-07-15 21:00:43'),(891,'it','CONTACT_FORM__SUBMIT_BTN__LABEL','Inviare','2018-07-15 21:00:43','2018-07-15 21:00:43'),(892,'it','PRIVACY__MENU__ITEM','politica sulla riservatezza','2018-07-15 21:00:43','2018-07-15 21:00:43'),(893,'it','PRIVACY__META__TITLE','Termini di servizio','2018-07-15 21:00:43','2018-07-15 21:00:43'),(894,'it','PRIVACY__META__KEYWORDS','Termini di servizio','2018-07-15 21:00:43','2018-07-15 21:00:43'),(895,'it','PRIVACY__META__DESCRIPTION','Termini di servizio','2018-07-15 21:00:43','2018-07-15 21:00:43'),(896,'it','PRIVACY__PAGE__TITLE','Titolo della pagina sulla privacy','2018-07-15 21:00:43','2018-07-15 21:00:43'),(897,'it','PRIVACY__PAGE__SUBTITLE','Sottotitolo della pagina sulla privacy','2018-07-15 21:00:43','2018-07-15 21:00:43'),(898,'it','PRIVACY__PAGE__CONTENT','Smartjex.com (\"smartjex.com\" o \"noi\") controlla e fornisce l\'accesso al sito smartjex.com, attualmente disponibile su www.smartjex.com (il \"Sito Web\"). In smartjex.com, ci impegniamo a rispettare la tua privacy e a proteggere qualsiasi informazione fornita dai nostri clienti. La vostra privacy e sicurezza sono entrambe le nostre priorità più alte e facciamo ogni sforzo per garantire che tutte le informazioni fornite da voi siano protette. Questa Informativa sulla privacy (la \"Politica\") è progettata per informarti sui termini di trattamento dei tuoi dati personali.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(899,'it','PRIVACY__PAGE__PERSONAL__TITLE','## Informazione personale','2018-07-15 21:00:43','2018-07-15 21:00:43'),(900,'it','PRIVACY__PAGE__PERSONAL','Per accedere alle funzionalità del sito Web, è necessario registrarsi. Al momento della registrazione, ti verrà chiesto di fornire un indirizzo email e creare una password. Puoi anche scegliere di collegarti al sito web utilizzando uno dei tuoi account sui social network, come Twitter, Facebook e Google+.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(901,'it','PRIVACY__PAGE__RECORD__TITLE','## Raccolta di record','2018-07-15 21:00:43','2018-07-15 21:00:43'),(902,'it','PRIVACY__PAGE__RECORD__CONTENT','Dal momento in cui ti registri su smartjex.com, il nostro software inizierà a raccogliere le tue informazioni di identificazione non personali. Tali informazioni possono includere il nome del browser e le informazioni tecniche relative ai mezzi di connessione al nostro sito Web, in particolare il sistema operativo e i provider di servizi Internet utilizzati tra altre informazioni simili.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(903,'it','PRIVACY__PAGE__CONTACT__TITLE','## contattandoci','2018-07-15 21:00:43','2018-07-15 21:00:43'),(904,'it','PRIVACY__PAGE__CONTACT__CONTENT','In caso di domande sulla presente Informativa sulla privacy o sulle regole di smartjex.com, si prega di contattarci all\'indirizzo: [support@smartjex.com] (mailto: support@smartjex.com)','2018-07-15 21:00:43','2018-07-15 21:00:43'),(905,'it','TERMS__MENU__ITEM','Termini d\'uso e Informativa sulla privacy','2018-07-15 21:00:43','2018-07-15 21:00:43'),(906,'it','TERMS__META__TITLE','Termini di servizio','2018-07-15 21:00:43','2018-07-15 21:00:43'),(907,'it','TERMS__META__KEYWORDS','termini, privacy','2018-07-15 21:00:43','2018-07-15 21:00:43'),(908,'it','TERMS__META__DESCRIPTION','Termini di utilizzo meta description','2018-07-15 21:00:43','2018-07-15 21:00:43'),(909,'it','TERMS__PAGE__TITLE','Termini di servizio','2018-07-15 21:00:43','2018-07-15 21:00:43'),(910,'it','TERMS__PAGE__SUBTITLE','Condizioni dettagliate','2018-07-15 21:00:43','2018-07-15 21:00:43'),(911,'it','TERMS__PAGE__CONTENT','Smartjex.com è un sito Web e una piattaforma online che consente lo scambio criptovalute, ovvero lo scambio di denaro digitale non regolamentato, che viene emesso e solitamente controllato dai suoi sviluppatori, e utilizzato e accettato tra i membri di specifiche comunità virtuali, inclusi ma non limitato a Bitcoin, NEO, Ether, Litecoin, Ripple, Dash, ecc. utilizzando il miglior tasso di cambio.\nUtilizzando il sito Web https://smartjex.com/ e accettando ulteriormente di avvalersi dei servizi offerti dal sito Web (\"Servizio\"), l\'utente accetta di accettare e rispettare i Termini e le condizioni d\'uso qui sotto riportati (\"Termini d\'uso\").\nAccedendo al sito Web, l\'utente accetta di essere vincolato dai nostri Termini e da tutte le leggi, norme e regolamenti applicabili, e di essere responsabile per la conformità con essi e di rispettare tutte le leggi, le norme e i regolamenti applicabili. Se non sei d\'accordo con uno dei nostri Termini, devi smettere di usare il sito web. Qualsiasi utilizzo del sito implica l\'accettazione dei nostri Termini.\nSmartjex si riserva il diritto di apportare modifiche al nostro sito, alle politiche e ai termini di utilizzo in qualsiasi momento. Il contenuto delle pagine del sito web è per le tue informazioni generali e solo l\'uso. E \'soggetto a modifiche senza preavviso.\nUtilizzando il sito Web, l\'utente dichiara di avere almeno 18 anni e ha il diritto di stipulare un contratto in base alla legge applicabile, rispettando e rispettando tutte le leggi, norme e regolamenti applicabili sia del proprio paese di residenza sia del dominio di competenza di Smartjex (\" Legislazione\").\nI presenti Termini di servizio, la Dichiarazione sulla privacy e sulla trasparenza (i \"Termini\") e tutti gli altri accordi tra Smartjex e i suoi utenti utilizzeranno le seguenti definizioni:\nun. \"Cliente\", \"utente\", \"cliente\", \"tu\" e \"nostro\" si riferiscono alla persona o all\'entità che accede e / o utilizza Smartjex.\nb. \"Azienda\", \"Smartjex\", \"Sito web\", \"Servizio\", \"noi\" e \"noi\" si riferiscono collettivamente al sito Web online e a tutti i prodotti che utilizzano l\'API Smartjex, i suoi proprietari, direttori, funzionari, dipendenti, operatori, agenti, assicuratori, fornitori e avvocati.\nd. \"Asset\", \"asset digitale\", \"moneta\", \"valuta crittografica\", \"fondi\", \"buono\", \"voce della contabilità generale\" e \"token\" si riferiscono collettivamente al denaro digitale non regolamentato, che viene emesso e solitamente controllato dal suo sviluppatori, e utilizzati e accettati tra i membri di specifiche comunità virtuali, inclusi, ma non limitati, Bitcoin, NEO, Ether, Litecoin, Ripple, Dash, ecc.\ne. I \"partner\" sono servizi che Smartjex utilizza per condurre operazioni di scambio, sono elencati nel footer del Sito;','2018-07-15 21:00:43','2018-07-15 21:00:43'),(912,'it','CURRENCIES__MENU__ITEM','Valute supportate','2018-07-15 21:00:43','2018-07-15 21:00:43'),(913,'it','TERMS__PAGE__CONTENT__FOOTER','1. Smartjex non è né il creatore né l\'amministratore di alcuna criptovaluta. Agisce semplicemente come aggregatore e intermediario tra l\'utente e i vari partner in tutto il mondo attraverso siti Web esterni.\n2. Il servizio fornito da Smartjex consente a tutti gli utenti del sito Web di scambiare criptovaluta direttamente con altre criptovalute da vari scambi di valute virtuali.\n3. Smartjex offre servizi di informazione intermediari per gli utenti. Serviamo solo come interfaccia e compilazione di piattaforme. Le transazioni finanziarie vengono eseguite dai partner.\n4. Smartjex ti concede una licenza revocabile non trasferibile limitata non esclusiva per utilizzare il Servizio gratuitamente.\n5.Smartjex accetta una commissione di cambio per l\'utilizzo del servizio. La commissione è pari all\'1% della transazione. La commissione può essere soggetta a fluttuazioni ragionevoli a causa dell\'arrotondamento matematico. La tassa è già inclusa nelle offerte elencate. Le spese di blockchain indipendenti non sono incluse nella somma totale, puoi controllarle nel tuo portafoglio durante la transazione stessa.\n6.Smartjex ha il diritto di rifiutare le operazioni e di non rimborsare i tuoi beni se violi i Termini o la legislazione.\n7. Accetti di utilizzare i tuoi portafogli digitali, i loro indirizzi (\"Portafoglio\") e Risorse. Non devi utilizzare Wallet o Attività di qualcun altro.\n8. È vietato utilizzare o accedere a Smartjex in modo abusivo. Ciò può includere, senza limitazioni e a sola discrezione di Smartjex, la presentazione di transazioni o altri dati che impongono un carico irragionevole o ingestibilmente grande sulla piattaforma Smartjex, indipendentemente dal fatto che interferisca o meno con le normali operazioni.\n9.Smartjex non è responsabile per la modifica del tasso di cambio a causa della volatilità del mercato. Fissiamo il tasso di cambio al momento dell\'invio, con una precisione entro 90 minuti. Prendiamo i dati dai seguenti siti tramite la loro API. Non possiamo prevedere quanto tempo impiegherà la transazione e non possiamo stabilire l\'ammontare massimo di attività che riceverete.\n10.Smartjex restituirà le risorse iniziali sul Portafoglio dichiarato se l\'operazione di scambio non viene superata entro il periodo di 90 minuti.\n11.Non puoi annullare l\'operazione dopo aver trasferito denaro dal tuo portafoglio.\n12. Nessun dato di valore viene raccolto, memorizzato da Smartjex o trasmesso a entità di terze parti.\n13.Smartjex non opera, non effettua transazioni e non conduce altrimenti attività commerciali con moneta legale. Operiamo solo, effettuiamo transazioni e conduciamo in altro modo attività imprenditoriali con attività criptoattive.\n14.Non commenti, opinioni, post, recensioni o altri media scritti o audio sul sito, blog o altri progetti secondari che utilizzano il codice di Smartjex devono essere considerati consigli o raccomandazioni finanziari ufficiali o certificati per l\'investimento. Smartjex non è responsabile per la sicurezza di monete e gettoni offerti dai partner.\n15. Gli utenti sono responsabili dell\'accuratezza della specifica dei loro dati, inclusi, a titolo esemplificativo ma non esaustivo, gli indirizzi di portafogli e le specifiche delle risorse. In caso contrario, Smartjex non sarà in grado di restituire, trasferire e condurre altre transazioni.\n16.Smartjex prende una decisione unilaterale sulla restituzione dei fondi e sul tasso di rimborso. Non puoi fare ricorso contro di esso.\n17. Smartjex non è responsabile per perdite, danni o danni derivanti dall\'accesso a falsi ritratti del sito o servizi correlati da entità non affiliate che si ritengono intenzionalmente o non intenzionalmente correlate al o connesse al sito. Ti consigliamo di verificare che l\'indirizzo web sia https://smartjex.com/\n18. Tutti i disaccordi e gli obblighi legali sono risolti secondo le leggi e la legislazione della Repubblica di Cipro.\n19.Smartjex non è responsabile per eventuali perdite, causate da qualsiasi motivo, mentre si lavora con Exchange. Eventuali perdite causate da attività di terzi devono essere risolte dall\'utente.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(914,'it','CURRENCIES__META__TITLE','Cambio valute supportate | SMARTJEX','2018-07-15 21:00:43','2018-07-15 21:00:43'),(915,'it','CURRENCIES__META__KEYWORDS','Cambio valute supportate','2018-07-15 21:00:43','2018-07-15 21:00:43'),(916,'it','CURRENCIES__META__DESCRIPTION','Valute supportate per la conversazione','2018-07-15 21:00:43','2018-07-15 21:00:43'),(917,'it','CURRENCIES__PAGE__TITLE','Valute supportate','2018-07-15 21:00:43','2018-07-15 21:00:43'),(918,'it','CURRENCIES__PAGE__SUBTITLE','Ora stiamo supportando oltre %d criptovalute per operare su tutte le principali borse','2018-07-15 21:00:43','2018-07-15 21:00:43'),(919,'it','CURRENCIES__SEARCH_FIELD__PLACEHOLDER','Cerca valute','2018-07-15 21:00:43','2018-07-15 21:00:43'),(920,'it','CURRENCIES__TABLE__COLUMN__NAME_AND_SYMBOL','Nome e Ticker','2018-07-15 21:00:43','2018-07-15 21:00:43'),(921,'it','CURRENCIES__TABLE__COLUMN__RATE','Vota','2018-07-15 21:00:43','2018-07-15 21:00:43'),(922,'it','CURRENCIES__TABLE__COLUMN__1_HOUR_CHANGES','1 ora','2018-07-15 21:00:43','2018-07-15 21:00:43'),(923,'it','CURRENCIES__TABLE__COLUMN__24_HOURS_CHANGES','24 ora','2018-07-15 21:00:43','2018-07-15 21:00:43'),(924,'it','CURRENCIES__TABLE__COLUMN__7_DAYS_CHANGES','7 giorni','2018-07-15 21:00:43','2018-07-15 21:00:43'),(925,'it','CURRENCIES__TABLE__EXCHANGE_BUTTON','Scambio %s','2018-07-15 21:00:43','2018-07-15 21:00:43'),(926,'it','FAQ__MENU__ITEM','FAQ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(927,'it','FAQ__META__TITLE','FAQ: Domande e risposte di base | SMARTJEX','2018-07-15 21:00:43','2018-07-15 21:00:43'),(928,'it','FAQ__META__KEYWORDS','FAQ, domande e risposte di base ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(929,'it','FAQ__META__DESCRIPTION','Trova le risposte alle domande che ti interessano negli scambi di criptovaluta','2018-07-15 21:00:43','2018-07-15 21:00:43'),(930,'it','FAQ__PAGE__TITLE','FAQ','2018-07-15 21:00:43','2018-07-15 21:00:43'),(931,'it','FAQ__PAGE__SUBTITLE','Domande e risposte di base','2018-07-15 21:00:43','2018-07-15 21:00:43'),(932,'it','FAQ__HAVE_QUESTION__TITLE','Il tuo problema non è elencato qui?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(933,'it','FAQ__HAVE_QUESTION__CONTENT','Hai un problema o una domanda sul nostro servizio?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(934,'it','FAQ__HAVE_QUESTION__CONTACT_BUTTON','Raggiungici','2018-07-15 21:00:43','2018-07-15 21:00:43'),(935,'it','FAQ__SECTION__STEP_1__TITLE','Passaggio 1. Offerte','2018-07-15 21:00:43','2018-07-15 21:00:43'),(936,'it','FAQ__SECTION__STEP_2__TITLE','Passaggio 2. Dettagli','2018-07-15 21:00:43','2018-07-15 21:00:43'),(937,'it','FAQ__SECTION__STEP_3__TITLE','Passaggio 3. Riepilogo','2018-07-15 21:00:43','2018-07-15 21:00:43'),(938,'it','TRACK_ORDER__SUBMIT_BTN','Traccia','2018-07-15 21:00:43','2018-07-15 21:00:43'),(939,'it','TRACK_ORDER__MENU_ITEM','Ordine dei brani','2018-07-15 21:00:43','2018-07-15 21:00:43'),(940,'it','ADVANTAGE__ITEM__TRUSTY__TITLE','Fidato','2018-07-15 21:00:43','2018-07-15 21:00:43'),(941,'it','ADVANTAGE__ITEM__ANONYMOUS__CONTENT','Non richiediamo né memorizziamo i tuoi dati personali. Tutto ciò di cui abbiamo bisogno è l\'indirizzo del tuo portafoglio per le monete target.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(942,'it','ADVANTAGE__ITEM__ANONYMOUS__TITLE','Anonimo','2018-07-15 21:00:43','2018-07-15 21:00:43'),(943,'it','ADVANTAGE__ITEM__FAST__CONTENT','Semplice processo in tre fasi: 1) selezionare la criptovaluta necessaria, 2) inserire l\'indirizzo del portafoglio, 3) inviare la crittografia iniziale a un determinato portafoglio. Questo è tutto!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(944,'it','ADVANTAGE__ITEM__FAIR__TITLE','Giusto','2018-07-15 21:00:43','2018-07-15 21:00:43'),(945,'it','TRACK_ORDER__INPUT_PLACEHOLDER','Inserisci l\'ID dell\'ordine','2018-07-15 21:00:43','2018-07-15 21:00:43'),(946,'it','PARTNERS__SECTION__TITLE','I nostri partner','2018-07-15 21:00:43','2018-07-15 21:00:43'),(947,'it','HOW_IT_WORKS__SECTION__TITLE','Come funziona','2018-07-15 21:00:43','2018-07-15 21:00:43'),(948,'it','HOW_IT_WORKS__ITEM__COMPARE__TITLE','Scegliere','2018-07-15 21:00:43','2018-07-15 21:00:43'),(949,'it','ADVANTAGE__SECTION__TITLE','Vantaggi','2018-07-15 21:00:43','2018-07-15 21:00:43'),(950,'it','HOW_IT_WORKS__ITEM__CONVERT__TITLE','Scegliere','2018-07-15 21:00:43','2018-07-15 21:00:43'),(951,'it','ADVANTAGE__ITEM__TRUSTY__CONTENT','Fidato. Non eseguiamo lo scambio: viene elaborato dalle piattaforme attendibili. Smartjex serve solo come interfaccia e compilazione di queste piattaforme.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(952,'it','HOW_IT_WORKS__ITEM__CONVERT__CONTENT','Imposta una coppia di monete e scegli la piattaforma di scambio, inserisci gli indirizzi del tuo portafoglio, invia la crittografia e aspetta.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(953,'it','HOW_IT_WORKS__ITEM__TRACK__CONTENT','È possibile tenere traccia dello stato del proprio scambio tramite il collegamento diretto all\'operazione su Block Explorer. Inoltre, forniamo un feedback accurato durante l\'intera operazione sulla stessa pagina.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(954,'it','SEO__SECTION__TITLE','Scambio di criptovaluta','2018-07-15 21:00:43','2018-07-15 21:00:43'),(955,'it','ADVANTAGE__ITEM__FAST__TITLE','Veloce','2018-07-15 21:00:43','2018-07-15 21:00:43'),(956,'it','REVIEWS__SECTION__TITLE','Recensioni','2018-07-15 21:00:43','2018-07-15 21:00:43'),(957,'it','ADVANTAGE__ITEM__FAIR__CONTENT','Non ci sono commissioni di cambio nascoste - si paga solo la quota delle piattaforme, già inclusa nella lista (inoltre, offriremo l\'opzione migliore!). E puoi accedere a %d monete e gettoni e portarli direttamente al tuo portafoglio. Per fare un confronto con una borsa, si pagano le commissioni di cambio e di prelievo.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(958,'it','FAQ__QUESTION__1','Ok, voglio scambiare qualche criptovaluta. Significa che avrai accesso al mio portafoglio?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(959,'it','FAQ__QUESTION__2','Come faccio a sapere che sono sul sito ufficiale?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(960,'it','FAQ__ANSWER__2','Guarda la barra degli indirizzi: il sito ufficiale di Smartjex ha un https:// sicuro, e il suo unico indirizzo è https://smartjex.com','2018-07-15 21:00:43','2018-07-15 21:00:43'),(961,'it','HOW_IT_WORKS__ITEM__COMPARE__CONTENT','Una volta impostata la coppia di scambio, facciamo il resto: ricerca, confronta le opzioni e offri le migliori tariffe.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(962,'it','FAQ__ANSWER__3','I nostri algoritmi esaminano le tariffe e le tariffe in base all\'importo scambiato e lo confrontano su 4 piattaforme (scambi, ecc.) Al fine di calcolare la tariffa migliore.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(963,'it','FAQ__QUESTION__4','Cos\'è una \"offerta di fondo\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(964,'it','HOW_IT_WORKS__ITEM__TRACK__TITLE','Traccia','2018-07-15 21:00:43','2018-07-15 21:00:43'),(965,'it','FAQ__QUESTION__5','Che cos\'è un \"importo minimo\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(966,'it','FAQ__ANSWER__5','È la quantità più bassa della cripta selezionata che puoi scambiare. Si noti che l\'importo è diverso per ogni moneta / gettone. Dipende dalla commissione di transazione, dalle specifiche e dalle tariffe delle piattaforme e dalla quantità richiesta della crittografia.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(967,'it','SEO__SECTION__CONTENT','Il numero di criptovalute e i metodi per gestirli sono estremamente diversi: almeno, gli approcci di trading contro holding e ribilanciamento. Di norma, le persone scambiano bitcoin e altcoin in una borsa, ma se non si è un daytrader, il processo diventa doloroso. Una borsa richiede la registrazione. Non è sicuro conservare i fondi perché non c\'è un portafoglio leggero. Devi pagare le commissioni di cambio e di prelievo e non c\'è posto dove siano elencati tutti i tipi di altcoin. Una soluzione intelligente per ottenere accesso rapido e sicuro a vari criptati e bypassare gli scambi avviene tramite un criptoconvertitore. Permetteteci di introdurre Smartjex, un multiconverter intelligente in grado di scambiare bitcoin o qualsiasi crittografia, calcolare le migliori tariffe e inviarlo rapidamente al vostro portafoglio. Inoltre, Smartjex offre una più ampia varietà di altcoin perché è integrato da una serie di piattaforme fidate. Vogliamo che Smartjex faciliti il tuo \"cryptostory!\"','2018-07-15 21:00:43','2018-07-15 21:00:43'),(968,'it','FAQ__ANSWER__6','Significa il margine tra l\'offerta inferiore e superiore, in base alla tua richiesta.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(969,'it','FAQ__QUESTION__7','Perché offri diverse opzioni se c\'è sempre la migliore?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(970,'it','FAQ__ANSWER__1','No. Riceverai un indirizzo e potrai inviare la tua criptovaluta da lì da solo. Smartjex non richiederà alcun accesso.\nE non puoi mai essere troppo accurato: non la tua frase principale, la tua chiave privata e la password per nessuno!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(971,'it','FAQ__QUESTION__8','Cosa significa \"in USD\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(972,'it','FAQ__ANSWER__8','È possibile impostare l\'importo stimato che si desidera scambiare in dollari statunitensi (USD). Lo ricalcoleremo in cripto.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(973,'it','FAQ__QUESTION__3','Come conosci la migliore tariffa?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(974,'it','FAQ__ANSWER__9','Ti suggeriamo ogni possibile modo per scambiare il tuo cripto. Se le piattaforme seguono tutto il resto tranne l\'importo impostato principalmente, ci sarà un suggerimento su come è possibile modificarlo per includerlo nella piattaforma, se si decide di farlo.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(975,'it','FAQ__QUESTION__10','Perché sono offerte piattaforme diverse ogni volta?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(976,'it','FAQ__ANSWER__4','È l\'offerta disponibile più non redditizia. Ti aiuta a vedere la differenza tra questo e l\'offerta più redditizia.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(977,'it','FAQ__QUESTION__11','Come fai a sapere quando ti ho mandato le mie monete?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(978,'it','FAQ__ANSWER__11','Creiamo un indirizzo unico per ogni richiesta. Otterrai il codice hash (dettagli crittografati della transazione) per controllarlo sulla blockchain, se lo desideri.\nControlliamo e aggiorniamo lo stato ogni 60 secondi. Di norma, questo è sufficiente, ma in rari casi può richiedere più tempo (3-4 controlli)','2018-07-15 21:00:43','2018-07-15 21:00:43'),(979,'it','FAQ__QUESTION__6','Cosa significa \"I save 25%\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(980,'it','FAQ__ANSWER__12','Sì, puoi impostare l\'indirizzo del deposito e ti invieremo le tue monete. Vai a Profilo> Deposito / Prelievi e scegli l\'indirizzo di deposito per la valuta selezionata.\nSi noti che in questo caso la transazione potrebbe richiedere più tempo.\nSuggeriamo anche di controllare il limite di prelievo per ogni moneta perché diversi scambi hanno regole diverse su quanta criptazione può essere scambiata. È importante che le vostre partecipazioni non vengano \"trattenute\".','2018-07-15 21:00:43','2018-07-15 21:00:43'),(981,'it','FAQ__ANSWER__7','Fornendo diverse opzioni forniamo ai nostri utenti una panoramica dello stato delle cose. Anche per consentire loro di scegliere in base alle loro preferenze.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(982,'it','FAQ__ANSWER__13','Sì, è possibile, ma essere a conoscenza di costi aggiuntivi e un periodo prolungato di tempo.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(983,'it','FAQ__QUESTION__14','Dimmi di più sulle tasse','2018-07-15 21:00:43','2018-07-15 21:00:43'),(984,'it','FAQ__ANSWER__14','Ci sono le commissioni delle piattaforme di scambio: la ricompensa che una piattaforma richiede per il suo servizio. Smartjex esamina tutti questi dati e offre la migliore opzione complessiva.\nE ci sono tariffe di rete che consentono alla blockchain di funzionare. Lo vedrai direttamente nel tuo account.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(985,'it','FAQ__QUESTION__9','Cosa significa \"limite di esigenze aggiustate\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(986,'it','FAQ__ANSWER__15','15-60 minuti complessivi, 30 minuti in media.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(987,'it','FAQ__QUESTION__16','Cosa succede se la velocità cambia durante l\'operazione?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(988,'it','FAQ__ANSWER__10','Alcune piattaforme non supportano coppie scelte o potrebbero non essere disponibili - suggeriamo solo la lista selezionata, per risparmiare tempo e denaro!','2018-07-15 21:00:43','2018-07-15 21:00:43'),(989,'it','FAQ__QUESTION__17','Ho calcolato che riceverò una quantità di crittografia, ma ho ottenuto una quantità leggermente diversa - perché?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(990,'it','FAQ__QUESTION__12','Posso ricevere nuove monete inviate direttamente al mio indirizzo di scambio?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(991,'it','FAQ__QUESTION__18','Che cos\'è un indirizzo di rimborso?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(992,'it','FAQ__ANSWER__18','È l\'indirizzo in cui memorizzi le monete che vuoi scambiare. Ad esempio, se hai BTC e vuoi ottenere DogeCoin (DOGE), il tuo indirizzo di rimborso sarà il tuo indirizzo BTC.\nNon è necessario che sia lo stesso indirizzo o portafoglio da cui si invia il BTC.\nSe qualcosa va storto e l\'operazione viene annullata, invieremo la tua criptovaluta iniziale a questo indirizzo.\nC\'è una probabilità estremamente bassa che ciò si verifichi, ma per sicurezza, forniamo un indirizzo di rimborso ..','2018-07-15 21:00:43','2018-07-15 21:00:43'),(993,'it','FAQ__QUESTION__13','Posso depositare monete da uno scambio?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(994,'it','FAQ__QUESTION__19',' Qual è l\'indirizzo di destinazione?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(995,'it','FAQ__QUESTION__20','Cosa succede se inserisco l\'indirizzo sbagliato?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(996,'it','FAQ__ANSWER__20','Abbiamo il controllo iniziale per l\'indirizzo e la correlazione con le valute crittografiche selezionate (es. Indirizzo Bitcoin Cash (BCC) per iniziare con il suo prefisso, ecc.), Ma se commetti un errore, rischi di inviare i tuoi fondi a un estraneo o li perdi in blockchain per sempre. Questa operazione è irreversibile.\nPer evitare errori, non copiare il tuo indirizzo, ma manualmente, usa il pulsante \"copia\":\n[per esempio: https://d.pr/i/QYVCfy]','2018-07-15 21:00:43','2018-07-15 21:00:43'),(997,'it','FAQ__QUESTION__15','Quanto durerà la transazione?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(998,'it','FAQ__QUESTION__21','Perché non riesco a modificare la destinazione della criptovaluta durante il terzo passaggio?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(999,'it','FAQ__ANSWER__21','Una volta scelta la coppia desiderata, ti mostriamo le condizioni e i vantaggi. Dal momento che lo accetti, ci concentriamo sui dettagli della transazione in modo da non essere confusi dai dati aggiuntivi. Pertanto, sarai in grado di compilare correttamente i tuoi indirizzi.\nSe si desidera scambiare altre criptovalute, si prega di visitare i passaggi precedenti e fare di nuovo la scelta.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1000,'it','FAQ__QUESTION__22','Cos\'è un \"ID ordine\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1001,'it','FAQ__ANSWER__16','Consideriamo un margine di sicurezza del ~ 10% per coprire la possibile volatilità del tasso quando una transazione è in corso. Otterrai il 100% dei fondi disponibili scambiati al momento della transazione.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1002,'it','FAQ__QUESTION__23','Posso aggiornare la pagina o chiudere la finestra del mio browser?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1003,'it','FAQ__ANSWER__22','È il collegamento univoco dell\'indirizzo di accesso al rapporto operativo. Ne hai bisogno per verificare lo stato dell\'operazione. Puoi anche inviare il link alla tua email','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1004,'it','FAQ__ANSWER__17','Questo a causa della volatilità. Il tasso è estremamente volatile a causa di ragioni macroeconomiche. Ad esempio, la velocità di Bitcoin (BTC) cambia nell\'1% ogni secondo. Non comprare l\'esatta quantità di cripto che ti serve, ma lascia un margine di errore.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1005,'it','FAQ__ANSWER__23','Sì, puoi, e non influenzerà nulla. È sempre possibile riaprire il passaggio di riepilogo.\nSe hai chiuso la scheda per sbaglio, ma non hai salvato il collegamento, il modo più rapido per ripristinarlo è premere SHIFT+CMD/CTRL+T.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1006,'it','FAQ__ANSWER__24','Una volta inviata la criptovaluta, ogni transazione viene scritta su blockchain e le informazioni vengono memorizzate lì per sempre.\nViene creato un riferimento univoco alla transazione denominata \"hash\" e puoi tracciare il suo stato lì.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1007,'it','FAQ__QUESTION__25','Che cosa riscatta il codice QR?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1008,'it','FAQ__ANSWER__19','È l\'indirizzo in cui riceverai le monete dopo lo scambio. Ad esempio, se hai BTC e vuoi scambiarlo con DOGE, il tuo indirizzo di destinazione sarà il tuo indirizzo DOGE.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1009,'it','FAQ__QUESTION__26','Cosa succede se invio la crittografia due volte?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1010,'it','FAQ__ANSWER__26','Ti invieremo l\'importo scambiato due volte, i tuoi soldi non saranno persi.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1011,'it','FAQ__ANSWER__27','Se invii più di quanto inizialmente impostato, ci scambiamo tutti i fondi.\nSe invii meno di quanto inizialmente impostato, ma al minimo, ci scambiamo i fondi.\nSe invii meno del minimo necessario, la transazione non funzionerà e ti verrà rimborsato. Per favore, considera l\'importo minimo annunciato.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1012,'it','FAQ__QUESTION__28','Come faccio a sapere che l\'operazione è stata completata?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1013,'it','CONVERTER__YOU__SEND','Tu invii','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1014,'it','CONVERTER__YOU__GET','Ottieni','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1015,'it','FAQ__QUESTION__24','Cosa significa \"vista su blockchain\"?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1016,'it','CONVERTER__EXCHANGE__BUTTON','Scambio','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1017,'it','CONVERTER__EXCHANGE__OR__COMPARE','o confrontare','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1018,'it','FAQ__ANSWER__25','Creiamo un indirizzo univoco e un codice QR univoco per ogni transazione.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1019,'it','CONVERTER__EXCHANGE__SAVED','salvato','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1020,'it','EXCHANGE__PAGE__STEPS__OFFERS','offerte','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1021,'it','FAQ__QUESTION__27','Cosa succede se invio una quantità di crittografia superiore o inferiore a quella che ho originariamente dichiarato?','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1022,'it','EXCHANGE__PAGE__STEPS__SUMMARY','Sommario','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1023,'it','CONVERTER__EXCHANGE__BY__FULL','I nostri partner','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1024,'it','FAQ__ANSWER__28','Verrà visualizzato lo stato \"Completato\" nella pagina Riepilogo. Oppure puoi controllare le monete / gettoni nuovi di zecca nel tuo portafoglio. Di norma, il processo di scambio richiede circa 15-60 minuti a seconda del carico di rete e delle piattaforme selezionate.','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1025,'it','CONVERTER__EXCHANGE__REFUND','indirizzo di rimborso','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1026,'it','CONVERTER__EXCHANGE__AGREE','Sono d\'accordo con il','2018-07-15 21:00:43','2018-07-15 21:00:43'),(1027,'i